import React, {useState} from 'react'

const [title, setTitle] = useState
const [thumbnail, setThumbnail] = useState

const Main = ({title, thumbnail}) => (
    <li>
        <div> {title} </div>
        <div> {thumbnail} </div>

    </li>
)

const MainNews = () => {
    const newsList = [
        {title: 'aa', thumbnail: 'bbb'},
        {title: 'cc', thumbnail: 'ddd'},
        {title: 'rr', thumbnail: 'ddd'}
        ]

    return (
        <ol>
            {newsList.map( ( newsList, index) => (
                <Main key={index} newsList={newsList}/>
            ))}
        </ol>
    )
}
export default MainNews
